import { Estudiantes } from "./components/Estudiantes";
import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Container } from "react-bootstrap";

function App() {
  return (
    <div className="App">
          <Navbar bg="light">
        <Container>
          <Navbar.Brand href="#home">Brand link</Navbar.Brand>
        </Container>
      </Navbar>
    <Estudiantes/>

    </div>
  );
}

export default App;
